function getObjectsByInstanceOf(t,o){let e=[];for(let n=0;n<t.height;n+=1)for(let a=0;a<t.width;a+=1){const r=t.gameZone[n][a];r instanceof o&&e.push(r)}return e}function getRandomIntInRange(t,o){return t=Math.ceil(t),o=Math.floor(o),Math.floor(Math.random()*(o-t+1))+t}function mapTeleport(t,o){return t<0&&(t=o-1),t>=o&&(t=0),t}function copyGameZone(t){let o=[];for(let e=0;e<t.height;e+=1){o[e]=[];for(let n=0;n<t.width;n+=1){const a=t.gameZone[e][n].isEmpty;o[e][n]=a}}return o}const Settings={width:40,height:24,minRoomCount:5,maxRoomCount:10,minRoomSize:3,maxRoomSize:8,minWaysCount:3,maxWaysCount:5,swordCount:2,swordBuff:1,potionCount:10,potionBuff:1,playerPower:2,playerHealth:10,enemyHealth:4,enemyPower:1,enemyCount:10};